import Forma from "./Forma";
export default function News({navigation}) {
    const loadNews = () => {
        navigation.navigate('thisNews');
    }
    const [dataNews, setDataNews ] = useState([
        { name: 'Tesla', anons:'Илон Масk купил твиттер',full:'Илон Маск продал почку и купил twitter',key:'1',img:'https://s0.rbk.ru/v6_top_pics/media/img/1/82/756756824446821.jpg'},
        { name: 'Mercedes', anons:'Тото Вольф разрушает команду',full:'Тото Вольф продал Хеммилтона',key:'2',img:'data:image/jpeg;base64,'},
        { name: 'Toyota', anons:'Супра вернулась',full:'В связи с возвращением супры, от сердечного приступа умерло 5 миллиардов школьников',key:'3',img:'data:image/jpeg;base64,'},
    ]);
    const [modalOpen, setModalOpen]=useState(false);
    const addNews = (novost) => {
       setDataNews((spisok) => {
           novost.key = Math.random().toString();
            return [
                novost,
                ...spisok
            ]
        })
       setModalOpen(false);
    }

    return (
        <View style={globalStyle.window} >
            <MaterialIcons name="post-add" size={50} color="white"  onPress={() => setModalOpen(true)}/>
            <Modal visible={modalOpen}>

                <View style={styles.forma}>
                    <SafeAreaView style={styles.pictureSlide}>
                        <View >
                    <Fontisto name="close-a" size={25} color="white" onPress={() => setModalOpen(false)}/>
                        </View>
                        <Text style={styles.textModul}>Создайте свою новость!</Text>
                    </SafeAreaView>

                    <Forma addNews ={addNews}/>
                </View>
            </Modal>
            <FlatList data={dataNews} renderItem={({item}) => (
                <TouchableOpacity style={styles.item} onPress={() => navigation.navigate('thisNews',item)}>
                    <View style={styles.NewFull}>
                <Image source={{
                    uri: item.img
                }} style={styles.img}
                />
                <Text style={styles.name}>{ item.name }</Text>
                <Text style={styles.anons}>{ item.anons }</Text>
                    </View>
                </TouchableOpacity>
                )}/>
        </View>

    );
}

